import HomePageContent from 'components/Home/homePageContent';
import React from 'react';
import { Route, Switch } from 'react-router-dom';

import './App.css';

const App = () => (
  <Switch>
    <Route exact path="/" component={HomePageContent} />
  </Switch>
);

export default App;
